BOOBS IN THE WOOD features Jim Davidson at his most outrageous. This hilarious adult panto captures the filthy follow-up to the saucy SINDERELLA in all its shocking glory. Filmed in front of a live audience, this naughty show features Davidson as the wicked Sheriff of Nottingham who has his eyes on the foxy Maid Marion.
